import React from "react";

const Shows = () => {
    console.log("shows")
    const arr= [ "edwin" , "thomas", "saju"]
    return(<>
      <Box p={15} pt={15} >
      <Grid container spacing={5}>
        {
          arr.map(ar => (<h1>{ar}</h1>) )
        }
      </Grid>
    </Box>
    </>)
}

export default Shows
